import React from 'react'
import "./Navbar.css";
import "./../../App.css";

export const Navbar = () => {
  return (
    <div className='fixed top-0 w-full h-[70px] flex justify-between py-4 px-4 items-center bg-grav'>
      <span className='text-[25px] font-semibold'>Bilan Mykhailo</span>
      <div className="flex justify-between gap-x-8">
        <a href="#">Homepage</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
      </div>
    </div>
  )
}
